#include<stdio.h>
int main(){
    for(int k=1;k<=100;k+=10){

        for(int i=1;i<=10;i++){
            for(int j=k;j<=k+9;j++){
            printf("%dx%d= %3d\t",j,i,j*i);
        }
        printf("\n");
     }
     printf("\n");
    }
return 0;
}

